(7, NULL, 'Beste {clientname},<br><br>\r\n\r\nDeze oefening is om je gewaar te worden van je eigen rol en jullie gezamenlijke rol/ dans binnen de relatie. Je kan deze beide invullen en vervolgens bespreken.<br><br>\r\n\r\nMet een hartelijke groet,<br><br>\r\n\r\nPascal Hoogewerf<br>\r\nPraktijk Hoogewerf<br>\r\n0229-758225<br>\r\ninfo@praktijkhoogewerf.nl<br>', 'Interactiecirkel', 4, 'phoogewerf@hotmail.com', '1595507657.pdf', '2019-10-24 06:53:45', '2020-07-23 14:38:02'),
(8, NULL, 'Beste {clientname},<br><br>\r\n\r\nBedankt voor jullie interesse in een relatietherapie weekend. Graag houden we een weekend of een dag die past bij jullie behoefte. Om een weekend/ dag te maken hebben wij wat vragen:\r\n\r\n1. Welke dingen gaan volgens jou goed in de relatie?\r\n2. Welke dingen zou je willen verbeteren of onderzoeken?\r\n3. Wat zou je willen bereiken?\r\n4. Wil je graag meerdere dagen een dag of een paar uur?\r\n5. Zouden jullie beide een stuk individuele therapie willen: dit kan bijvoorbeeld om te onderzoeken wat je zelf wil\r\n6. Willen jullie twee therapeuten? (Man en vrouw)\r\n7. Willen jullie meer dan praten? We doen veelal ook oefeningen. We pakken dan die oefeningen die passen bij jullie.\r\n8. Hebben jullie nog (specifieke / andere) wensen?\r\n9. Welke dagen zijn jullie hiervoor beschikbaar? (Wat zijn de mogelijkheden om af te spreken?)\r\n\r\n\r\nMet een hartelijke groet,<br>\r\nPraktijk Hoogewerf<br>\r\nwww.praktijkhoogewerf.nl<br>\r\n0229-758225', 'relatietherapie weekend vragen', 3, NULL, '', '2019-10-24 07:01:18', '2020-10-28 09:25:49'),
