INSERT INTO `pages` (`id`, `page_content`, `page_slug`, `page_subject`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, '<h3>Dashboard</h3>\r\n\r\n<p>In dashboard zie je eigen&nbsp;kalander. Je kan klikken op een afspraak dan kom je in booking view terecht. Hierin kan je&nbsp;de booking op betaald (paid) of niet betaald (unpaid) of contant betaald (cash paid) zetten. De cli&euml;nt ontvangt dan&nbsp;de juiste factuur. Je kan dit ook doen via menu booking.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><strong>in booking view</strong> zie je ook dat je de prijs kan aanpassen. Let op: een komma is een punt (&euro;85,50 = &euro;85.50). Ook kan je als een afspraak is geweest de datum en tijd aanpassen voor de factuur. Maar bij wijzigen afspraak:</p>\r\n\r\n<p><strong>Afspraak wijzigen:</strong>&nbsp;Je zal dan eerst de nieuwe afspraak moeten maken (make booking) en dan de andere deleten.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>Therapist availability&nbsp;</h3>\r\n\r\n<p>Hierin zie je welke therapeuten er nog meer op een locatie zijn.</p>\r\n\r\n<h3>Customer</h3>\r\n\r\n<p>Hierin zie je je eigen klanten. Als een adres of andere gegevens niet kloppen kan je dat hierin wijzigen</p>\r\n\r\n<h3>Working&nbsp;hours</h3>\r\n\r\n<p>Hierin geef je je standaard werkdagen en werkuren op en in welke locatie</p>\r\n\r\n<h3>Leaves</h3>\r\n\r\n<p>Als je meerdere dagen niet aanwezig bent kan je dit hier aangeven</p>\r\n\r\n<h3>Custom Timinng</h3>\r\n\r\n<p>Als je een dag of een middag vrij bent kan je dat hier aangeven. Als je meerdere custom timings geeft op een dag kan dit verwarrend zijn voor het systeem. Custom timing is dus een wijziging ten opzichte van de standaard working hours</p>\r\n\r\n<h3>Booking</h3>\r\n\r\n<p>Hierin zie je een overzicht van alle afspraken. Voor je eigen factuur kan je een selectie maken van de afgelopen maand en deze exporteren naar excel of pdf. Je kan door status te wijzigen facturen sturen dit kan ook via booking view (<strong>zie booking view uitleg onder dashboard)</strong></p>\r\n\r\n<h3>Small info</h3>\r\n\r\n<p>In de small info kan je in het kort aangeven als therapeut welke voorkeuren je hebt met boeken. Wil je nieuwe cli&euml;nten? Wil je een cli&euml;nten stop? Wil je 15 min tussen de afspraken in etc</p>\r\n\r\n<p>PIN CODE</p>\r\n\r\n<p>Om te pinnen wordt er gevraagd om een code, deze is om te herkennen dat jij als therapeut deze terminal hebt gebruikt.<br />\r\nLisa Kortenhorst&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;0000<br />\r\nJeanne Kuijer &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0001</p>\r\n\r\n<p>Christel K&ouml;nig &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 0002<br />\r\nMonique Papen&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1111<br />\r\nLinda Wennekers&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2222<br />\r\nMarije Delfsma&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3333<br />\r\nPetra van den Keijbus&nbsp; 4444<br />\r\nPascal Hoogewerf&nbsp; &nbsp; &nbsp; &nbsp; 5555<br />\r\nTrinette Ermans&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 6666<br />\r\nJanine Veerman&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;7777<br />\r\nDwight Dompig. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;8888&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\r\nAmy Weggemans:&nbsp; &nbsp; &nbsp; &nbsp; 9999<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'how_create_appointment', 'Systeem uitleg voor therapeuten', NULL, '2021-03-11 10:13:00', NULL);
